import React, { useState } from 'react';
import { Transition, TransitionGroup, CSSTransition } from 'react-transition-group';

const duration = 200;

  const ProfileTile:React.FC = (props) => {
    
    const [inProp, setInProp] = useState(false);

    return(
        <TransitionGroup>
            <CSSTransition in={inProp} timeout={duration} className="option">
                <div className="option-enter" onCl={() => setInProp(true)} onMouseOut={() => setInProp(false)} >
                    {props.children}
                </div>
            </CSSTransition>
        </TransitionGroup>
    );
  };

  export default ProfileTile;
